import React, { useState } from 'react';

export default function Signup() {
  const [form, setForm] = useState({ name: '', email: '', mobile: '', password: '' });

  const handleSubmit = (e) => {
    e.preventDefault();
    alert("Signup functionality pending backend.");
  };

  return (
    <div className="p-6 max-w-md mx-auto">
      <h1 className="text-xl font-bold mb-4">Signup</h1>
      <form onSubmit={handleSubmit} className="space-y-2">
        <input type="text" placeholder="Full Name" className="border p-2 w-full"
          onChange={(e) => setForm({ ...form, name: e.target.value })} />
        <input type="email" placeholder="Email" className="border p-2 w-full"
          onChange={(e) => setForm({ ...form, email: e.target.value })} />
        <input type="text" placeholder="Mobile" className="border p-2 w-full"
          onChange={(e) => setForm({ ...form, mobile: e.target.value })} />
        <input type="password" placeholder="Password" className="border p-2 w-full"
          onChange={(e) => setForm({ ...form, password: e.target.value })} />
        <button type="submit" className="bg-blue-600 text-white px-4 py-2 rounded">Signup</button>
      </form>
    </div>
  );
}
